import gql from 'graphql-tag';

/* eslint-disable react/prop-types */
const SINGLE_PRODUCT_QUERY = gql`
  query SINGLE_PRODUCT_QUERY($id: ID!) {
    Product(where: { id: $id })
  }
`;

function UpdateProduct({ id }) {
  return (
    <div>
      <p>Update {id}</p>
    </div>
  );
}

export default UpdateProduct;
